import React from "react";
import { ScrollStyle } from "./ScrollStyle";

const Scroll = props => {

    return (

        <ScrollStyle>
            <img className="scroll" src="/static/svg/scroll.svg" />

        </ScrollStyle>
    )

}

export default Scroll;
